{"id": "BDAMHcCUAAsCmV68vW", "title": "Soulard Mardi Gras", "description": "St Louis Mardi Gras, sets in a neighborhood whose french name - Soulard - means \u201cdrunkard\u201d, is the biggest Mardi Gras parade outside the South. The festivities last for weeks : they are punctuated by special events and activities and end with Fat Tuesday.", "category": "festivals", "labels": ["entertainment", "festival", "food", "music"], "rank": 100, "local_rank": 100, "aviation_rank": 0, "phq_attendance": 500000, "entities": [{"entity_id": "XJv99Tyi6aE3tYyVCmTmvQ", "name": "Soulard Mardi Gras", "type": "event-group", "category": "festivals", "labels": ["entertainment", "event-group", "festival", "food", "music", "recurring"], "description": "Literally \u201cFat Tuesday\u201d in French, Mardi Gras is intertwined with the Lenten season traditions of the Roman Catholic Church and with the cities of New Orleans and Rio de Janeiro. It\u2019s called Carnival in Rio. The Mardi Gras tradition in the United States began in 1703 with a celebration by French settlers in the city of Mobile, the first capital of colonial French Louisiana.", "timezone": "America/Chicago", "recurring": {"ical": "DTSTART;VALUE=DATE:20170106\nDURATION:P50D\nRRULE:FREQ=YEARLY;INTERVAL=1"}}], "duration": 4751999, "start": "2022-01-06T06:00:00Z", "end": "2022-03-02T05:59:59Z", "updated": "2021-11-16T08:43:29Z", "first_seen": "2021-11-16T04:10:24Z", "timezone": "America/Chicago", "location": [-90.2084282, 38.6052421], "geo": {"geometry": {"type": "Point", "coordinates": [-90.2084282, 38.6052421]}}, "scope": "locality", "country": "US", "place_hierarchies": [["6295630", "6255149", "6252001", "4398678", "4407084", "7206441"], ["6295630", "6255149", "6252001", "4398678", "4407084", "4407066"]], "state": "active", "brand_safe": true, "private": false}
