{ "title": "Sinatra At The Sands-featuring Scott Vignassi Orch", "description": "Tribute to Frank Sinatra at the Sands featuring Steve Shininger The Big Little Big Band is a 12 piece ensemble, made up of St. Louis area based professional musicians. They perform the classic sounds of the great big bands as well as modern arrangements of jazz standards. Scott Vignassi is the leader and jazz trumpet player for the ensemble. Retired from the USAF Band, he has had the privilege of performing with many notable jazz greats including Sammy Nestico, Arturo Sandoval, Maynard Ferguson, Marvin Stamm, and Toni Tennille. Steve Shininger is the featured vocalist with the Big Little Big Band. He has performed professionally for over 20 years, and has mastered the stylings of classic crooners like Frank Sinatra. The band: Lead trumpet Paul DeMerath/Scott Sauer Jazz trumpet Scott Vignassi Saxes Ryan Leatherman/Cody Brown/Mike Findlay Trombone John Alexander Tuba Matt Kuebler Featuring on Drums Joe Weber", "category": "performing-arts", "labels": ["entertainment", "performing-arts"], "rank": 30, "local_rank": 48, "aviation_rank": 0, "phq_attendance": 99, "entities": [{"formatted_address": "358 North Boyle Avenue\nSt. Louis, MO 63108\nUnited States of America", "type": "venue", "entity_id": "38nVmXcXtp9kpGtiSrrq5Du", "name": "Gaslight Theater"}], "duration": 0, "start": "2022-01-22T01:30:00Z", "end": "2022-01-22T01:30:00Z", "updated": "2021-12-22T00:38:13Z", "first_seen": "2021-12-22T00:36:39Z", "timezone": "America/Chicago", "location": [-90.2497671, 38.6425993], "geo": {"geometry": {"type": "Point", "coordinates": [-90.2497671, 38.6425993]}}, "scope": "locality", "country": "US", "place_hierarchies": [["6295630", "6255149", "6252001", "4398678", "4407084", "7206404"], ["6295630", "6255149", "6252001", "4398678", "4407084", "4407066"]], "state": "active", "brand_safe": true, "private": false}
